package db.domain;import java.util.Arrays;import java.util.Date;public class UmsOnlinenoImpl implements UmsOnlineno {	@Key	private int serverId;	private int onlineNumber;	private Date updateTime;	public UmsOnlinenoImpl() {	}	public UmsOnlinenoImpl(UmsOnlineno c) {		this.serverId = c.getServerId();		this.onlineNumber = c.getOnlineNumber();		this.updateTime = c.getUpdateTime();	}	@Override	public String tableName() {		return "ums_onlineno";	}	public void setServerId(int serverId) {		this.serverId = serverId;	}	public int getServerId() {		return this.serverId;	}public void addServerId(int serverId) {		this.serverId += serverId;}	public void setOnlineNumber(int onlineNumber) {		this.onlineNumber = onlineNumber;	}	public int getOnlineNumber() {		return this.onlineNumber;	}public void addOnlineNumber(int onlineNumber) {		this.onlineNumber += onlineNumber;}	public void setUpdateTime(Date updateTime) {		this.updateTime = updateTime;	}	public Date getUpdateTime() {		return this.updateTime;	}}